INSERT INTO `v1_fde36e816faee6cdfe0b10172d09829e0dd2cd35231e93589ac74ce55759a25b` VALUES (1, 0, 11, 129911, 6011, "マコトさん？\nどうかしましたか？\n何やら不穏な気配を\n感じ取ったのですが", 6, 0, 6, 0, 0.8);
